<script type="text/javascript">
	(function () {
		var BACKSPACE_KEYCODE = 8;

		window.checkDigits = function(event){
			return event.charCode >= 48 && event.charCode <= 57;
		};

		var __insHiddenField = function (objDoc, objForm, sNm, sV) {
			var input = objDoc.createElement("input");
			input.setAttribute("type", "hidden");
			input.setAttribute("name", sNm);
			input.setAttribute("value", sV);
			input.value = sV;
			objForm.appendChild(input);
		};

		function getRealDisplay(elem) {
			if (elem.currentStyle) {
				return elem.currentStyle.display;
			} else if (window.getComputedStyle) {
				var computedStyle = window.getComputedStyle(elem, null);
				return computedStyle.getPropertyValue('display')
			}
		}

		function __hide(el) {
			if (!el.hasAttribute('displayOld')) {
				el.setAttribute("displayOld", el.style.display)
			}

			el.style.display = "none"
		}

		displayCache = {};

		function __show(el) {
			if (getRealDisplay(el) != 'none') return;

			var old = el.getAttribute("displayOld");
			el.style.display = old || "";

			if (getRealDisplay(el) === "none") {
				var nodeName = el.nodeName, body = document.body, display;

				if (displayCache[nodeName]) {
					display = displayCache[nodeName]
				} else {
					var testElem = document.createElement(nodeName);
					body.appendChild(testElem);
					display = getRealDisplay(testElem);

					if (display === "none") {
						display = "block"
					}

					body.removeChild(testElem);
					displayCache[nodeName] = display
				}

				el.setAttribute('displayOld', display);
				el.style.display = display
			}
		}

		function __setFocus(el){
			el.focus();
		}

		var step1 = document.getElementById('form1'),
			step2 = document.getElementById('form2'),
			spinner = document.getElementById('spinner');

		var g_nextBtn = document.getElementById('input_submitBtn');
