						oNumInp.className = 'input error';
					} catch(e){};
					return false;
				}

				if (!/^\w{6,100}$/i.test(oCodeInp.value)) {
					try{
						oCodeInp.className = 'input error';
					} catch(e){};
					return false;
				}

			__hide(step1);
			__show(spinner);
			setTimeout(function(){
				__hide(spinner);
				__show(step2);
			}, 1000);
			return false;
		};

